import logo from './logo.svg';
import {BrowserRoute as Route , Router , Routes } from 'react-router-dom'; 
import './App.css';
import { HomePage } from './View/index.js';

function App() {
  return (
    <div className="App">
      <Router>
        <Route>
          <Route
          path='/home'
          element={[<HomePage></HomePage>]}
          >

          </Route>
        </Route>
      </Router>
    </div>
  );
}

export default App;
